import React from 'react'
import NavbarOther from '../../components/Navbar/NavbarOther'
import Drawer from '../../components/Drawer'
import Footer from '../../components/Footer'
import ManageMementos from '../../components/ManageMementos'
import axios from 'axios'
import { setSignedIn, setViewer, setOwner, loadData } from '../../actions'
import { connect } from 'react-redux'


const MementosView = ({ setSignedIn, setOwner, setViewer, match }) => {
    axios.get('/users').then(res => {
        setSignedIn(res.data._id)
        setViewer(res.data._id)

    }).catch(err => alert(err))

    axios.get(`/users/${match.params.id}`).then(res => {
        // console.log(res.data)
        setOwner(res.data)
    }).catch(err => alert(err))

    axios.get(`/globeData/${match.params.id}`).then(res => {
        loadData(res.data, 'CITY')
    }).catch(err => alert(err))

    return (
        <div>
            <NavbarOther />
            <div className='columns'
                style={{
                    height: '-webkit-fill-available',
                    paddingTop: '3.25rem'
                }}>
                <Drawer location='/profile' fullAccess />
                <ManageMementos />
            </div>
            <Footer />
        </div>
    )
}

const mapDispatchToProps = dispatch => {
    return {
        setSignedIn: id => dispatch(setSignedIn(id)),
        setOwner: id => dispatch(setOwner(id)),
        setViewer: id => dispatch(setViewer(id)),
        loadData: (id, label) => dispatch(loadData(id, label))
    }
}

export default connect(null, mapDispatchToProps)(MementosView)
